import React from 'react'


const Cart = (props) => {
    return (
        <div>
            <h2>ตะกร้าสินค้า : {props.cartLength}</h2>
            <span>ราคารวมทั้งหมด : {props.totalprice}</span>
        </div>
    )
}

export default Cart
